import React, { Component } from 'react';
import axios from "axios";

class Banner extends Component{
    constructor(props) {
        super(props);

    }

    render(){
        return(
            <div className="banner">
                <div>
                    {
                        this.props.bannerList.map((item, index)=>{
                            // console.log(item)
                            return (
                                <img src={item} />
                            )
                        })
                    }
                </div>
            </div>
        )
    }
}

export default Banner;
